import {BrowseRouter,Routes,Route} from "react-router-dom"
import Home from "./components/Home"

function App() {
  return (
    <div className="App">
      <BrowseRouter>
        <Routes>
          <Route path="/"   element={<Home />} />
        </Routes>
      </BrowseRouter>
    </div>
  );
}

export default App;
